// Home Page
import React from "react";
import "../css/Home.css";
import { IconSearch } from '@tabler/icons-react';

function Home() {
    return (
        <div className="HomePage">
            <div className="header">

                <div className="facebook-logo">
                    <div className="logo">
                        <img src="/images/logo.png" alt="logo" style={{height: "40px", paddingTop: "0.7rem", paddingLeft: "0.9rem"}}/>
                    </div>
                </div>
                <div className="search-bar">
                    <IconSearch stroke={2} />
                    <input />
                </div>
            </div>
        </div>
    )
}

export default Home;
